(7, 'Contact Us', 'Contact Us', '<p class="map-title"><strong>Newmark Knight Frank Devencore</strong></p>\r\n\r\n<p><strong>Address</strong>: 736-6th Avenue S.W.<br />\r\nSuite 2020&nbsp;Calgary, Alberta&nbsp; T2P 3T7&nbsp;CANADA.<br />\r\n<strong>Telephone</strong>: 403-265-9966<br />\r\n<strong>Fax</strong>: 403-262-5557<br />\r\n<strong>Email</strong>:&nbsp;<a class="mail-link" href="mailto:amiloti@nkfdcalgary.com">amiloti@nkfdcalgary.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><iframe frameborder="0" height="300" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d627.064709450153!2d-114.07795326306668!3d51.04830828418898!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x53716fe45cdaa3c1%3A0x6b4575858b9bd142!2sNewmark+Knight+Frank+Devencore!5e0!3m2!1sen!2sza!4v1452247137855" style="border:0" width="400"></iframe></p>\r\n', 'Contact Us', '', '', 'contact-us.php', 8, 1, 0, 0, 1),
(9, 'Terms of Use', 'Terms of Use', '<p><strong>Who owns the Web site?</strong></p>\r\n\r\n<p>The Web site http://www.devencorenkf.com (the &quot;Site&quot;) is made available by Devencore Investments Inc., the legal owner of the Site, its affiliated companies and/or licensors (&quot;NKF Devencore&quot;). Wherever the term &quot;Newmark Knight Frank Devencore &quot; shall appear in these Terms and Conditions, such terms shall also include NKF Devencore&#39;s officers, directors, employees, shareholders, members, managers, representatives, principals, and agents.</p>\r\n\r\n\r\n<p><br />\r\n<strong>What terms and conditions are you legally bound to?</strong></p>\r\n\r\n<p>By accessing this Site, you agree to be bound by these Terms of Use. If you do not agree to these Terms of Use, do not use this Site.</p>\r\n\r\n\r\n\r\n<p><br />\r\n<strong>What responsibility does NKF Devencore have concerning links and third party merchants?</strong></p>\r\n\r\n<p>NKF Devencore does not warrant the accuracy or completeness of the information or content included on any of the links on the Site provided by third party merchants or service providers (&quot;Vendor(s)&quot;). Any concerns you may have about any Vendors should be addressed directly to them. You acknowledge that NKF Devencore is not responsible for the accuracy, decency, or legality of any content of Web sites provided by Vendors. NKF Devencore does not endorse any Web site by Vendor linked to the Site.</p>\r\n\r\n<p>If you wish to access any link to a Vendor&#39;s Web site, you acknowledge and agree that NKF Devencore shall in no event be liable or responsible for any of the services or products to be provided by the Vendor and that NKF Devencore is not an agent or representative of the Vendor. You undertake any transactions with the Vendor at your own risk.</p>\r\n\r\n\r\n<p><br />\r\n<strong>What rights does NKF Devencore reserve with respect to copyrights and proprietary information?</strong></p>\r\n\r\n<p>You agree