<li>the content is accurate, reliable or correct;</li>\r\n	<li>the Site will be available at all times and at the same location;</li>\r\n	<li>any defects or errors will be corrected; or</li>\r\n	<li>that the content on the Site is free of viruses or other components.</li>\r\n</ul>\r\n\r\n<p>NKF Devencore makes no representation that the materials on the Site are appropriate or available for use in locations outside Canada. Accessing this Site from locations outside of Canada, therefore, may be prohibited.</p>\r\n\r\n<p>YOU UNDERSTAND AND ACKNOWLEDGE THAT YOU ARE USING THE SITE AT YOUR OWN RISK.</p>\r\n\r\n\r\n<p><br />\r\n<strong>What is NKF Devencore&#39;s liability?</strong></p>\r\n\r\n<p>To the extent permitted or required under law, under no circumstances shall NKF Devencore be liable for any direct, indirect, special, incidental, punitive, or consequential damages that result from the use of, or inability to use, the Site or for the use of any content thereof. The aforesaid limitation applies to any theory of recovery, including those claims based on tort or contract, even if NKF Devencore has been advised of the possibility of such damages.</p>\r\n\r\n\r\n<p><br />\r\n<strong>What is your liability when using the Site?</strong></p>\r\n\r\n<p>You may not reproduce, duplicate, copy, sell, resell, or otherwise exploit for any&nbsp; purpose the Site or any portions of the Site, unless expressly permitted by NKF Devencore.</p>\r\n\r\n\r\n\r\n<p><br />\r\n<strong>What other miscellaneous legal provisions do you have to adhere to?</strong></p>\r\n\r\n<p>These Terms and Conditions shall be governed by the laws of Canada, applicable to agreements made and to be performed entirely within Canada. You specifically agree that Canada has sole and exclusive jurisdiction and that you submit to the personal jurisdiction of the courts in Canada. The Terms and Conditions represent the entire agreement between you and NKF Devencore concerning the Site and supersede any and all other written or oral agreements. In the event any provision of these Terms and Conditions is found to be void or unenforceable by a court of competent jurisdiction, the remaining provisions shall nevertheless be binding upon you with the same effect as though the void or unenforceable part had been severed and deleted.</p>\r\n\r\n<p>You agree to defend, indemnify and hold harmless NKF Devencore from all liabilities, claims, losses and claims, including reasonable attorney&#39;s fees and costs that arise from your use of or access to the Site. NKF Devencore reserves the right to defend the claim, at its own expense, in which event you shall cooperate with NKF Devencore in the defense.</p>\r\n\r\n<p><br />\r\n<strong>What happens if our terms and conditions change?</strong></p>\r\n\r\n<p>We reserve the right to update, modify and amend these Terms and Conditions. All such changes shall be posted on the Site. Your continued use of the Site shall mean that you agree to any and all changes.</p>\r\n', 'Terms of Use', '', '', 'terms-of-use.php', 0, 0, 0, 0, 1),
(10, 'Privacy Policy', 'Privacy Policy', '<p>We are committed to protecting your privacy. This Privacy Policy sets forth our policies regarding the collection, disclosure and use of information relating to your use of this Site.&nbsp;We use the information we collect about you only in response to any inquiries made by you. Also, NKF Devencore may provide aggregate statistics about our customers, and related Site information to the personnel of NKF Devencore, but these statistics will include no personally identifying information. NKF Devencore may release account information when we believe, in good faith, that such release is reasonably necessary to (i) comply with law, (ii) enforce or apply the terms of any of our user agreements, or (iii) protect the rights, property, or safety of NKF Devencore, our users, or others.</p>\r\n\r\n<p>When you click on links and/or Vendor&#39;s ad banners that take you to third-party web sites, you will be subject to the third parties&#39; privacy policies, without liability to NKF Devencore. While we support the protection of privacy on the Internet, NKF Devencore cannot be responsible for the actions of third parties. We encourage you to read the posted privacy statement whenever interacting with any web site.</p>\r\n\r\n<p>By accessing our Site, you consent to the collection and use of this information by NKF Devencore. If we decide to change our privacy policy, we will post those changes on this page so that you are always aware of what information we collect, how we use it, and under what circumstances we disclose it.</p>\r\n\r\n<p>*&nbsp;&nbsp; All terms and/or expressions defined in the Terms of Use section apply herein.</p>\r\n', 'Privacy Policy', '', '', 'privacy-policy.php', 0, 0, 0, 0, 1),
(11, 'Our Mission', 'Our Mission', '<p>NKF&nbsp;Devencore&#39;s mission is to support executives in making sound decisions, which will allow them to improve the performance of their organization by providing unequalled expertise by highly specialized and commitment-oriented personnel. We are committed to provide objective and professional advice and to create value for our clients. Unlike traditional real estate brokers, NKF&nbsp;Devencore does not represent landlords or developers, nor does it seek management or listing contracts. As a result, our clients are assured that there are no conflicts of interest throughout every real estate activity.</p>\r\n\r\n<p>Towards that goal,&nbsp;NKF&nbsp;Devencore&nbsp;has assembled a team of diversified highly motivated professionals encompassing: negotiators, market analysts, architects, urban planners, financial analysts and lawyers. These dedicated professionals work in unison to provide a total comprehensive service to the client.</p>\r\n\r\n<p>NKF&nbsp;Devencore&#39;s strength lies in its ability to react quickly to a client&#39;s needs and to provide solutions that address any particular situation. Each and every member of&nbsp;NKF&nbsp;Devencore systematically applies the principles upon which the company&#39;s philosophy is based, namely to fully use every available resource to best serve clients and satisfy their specific needs.</p>', 'Our Mission', '', '', 'our-mission.php', 0, 0, 0, 0, 1),
(12, 'Our Culture', 'Our Culture', '<p>NKF&nbsp;Devencore&#39;s culture is to be a leading service partner providing advice and education to its clients. Our belief is to offer rigorous, unbiased service delivery models in a detailed, comprehensive, professional manner, respecting clients&#39; confidentiality and corporate expectations.&nbsp;NKF&nbsp;Devencore regards its client relationships as a privilege and views these as a long-term corporate commitment.&nbsp;NKF&nbsp;Devencore&nbsp;also believes that clients should have the ability to access anyone of its professionals at any time, without inconsequential charges.</p>\r\n\r\n<p>NKF&nbsp;Devencore&nbsp;recognizes that its environment must be conducive to nurture this culture.&nbsp;NKF&nbsp;Devencore&#39;s environment can be best described as follows:</p>\r\n\r\n<h3><strong>OUR People</strong></h3>\r\n\r\n<p>NKF&nbsp;Devencore&#39;s goal is to attract the best real estate professionals who share a passion for excellence, are client-driven and want to grow in a respectful and&nbsp;stimulating environment. As a result, the&nbsp;NKF&nbsp;Devencore&nbsp;Team and the Organization perform at a consistently superior level.</p>\r\n\r\n<h3><strong>OUR Professional Development Program</strong></h3>\r\n\r\n<p>NKF&nbsp;Devencore&#39;s reputation within the real estate industry is that of being the sole real estate service provider who has a continuous educational and training program.</p>\r\n\r\n<h3><strong>OUR&nbsp;Code of Ethics</strong></h3>\r\n\r\n<p>All employees sign a Code of Ethics statement which ensures all employees work towards the same goal and towards the same core values.&nbsp;</p>\r\n', 'Our Culture', '', '', 'our-culture.php', 0, 0, 0, 0, 1),
(13, 'Our Company', 'Our Company', '<p>Founded in 1972, with national coverage,&nbsp;NKF Devencore has successfully progressed over the years to become the leading real estate advisor and broker in Canada, working exclusively for corporate and public space occupants. We&nbsp;owe much of our success to the commitment we have made to tenant representation. Devencore Investments Inc. is the parent company of a number of subsidiaries, which are separate legal entities operating in various provincial jurisdictions. Devencore Investments Inc. and its operating companies are privately owned by local management and leaders of the organizations.</p>\r\n\r\n<p>NKF Devencore&#39;s strength lies in its ability to understand its clients&#39; objectives, react quickly to the client&#39;s needs, yet providing creative and effective solutions that address any particular situation. Each and every member of&nbsp;NKF&nbsp;Devencore systematically applies the principles upon which the Company&#39;s philosophy is based, namely to fully use every available resource to best serve clients and satisfy their needs.</p>\r\n\r\n<p>NKF Devencore&nbsp;has offices in&nbsp;Toronto, Montr&eacute;al, Ottawa and Vancouver, as well as affiliated offices in Calgary, Edmonton, Halifax and Qu&eacute;bec City.</p>\r\n\r\n<p>NKF&nbsp;Devencore&nbsp;is the exclusive Canadian partner&nbsp;of Newmark Knight Frank. Newmark Knight Frank has earned a reputation for providing innovative and seamless solutions for any real estate issue, regardless of geography. As a private company, they do not need to make decisions based on shareholder return or value perception. This enables the firm to remain profitable through numerous economic cycles, and positions it to provide a consistent level of service in any economic climate.</p>\r\n\r\n<p>Newmark Knight Frank is one of the largest independent real estate service firms in the world.&nbsp;Headquartered in&nbsp;New York,&nbsp;Newmark Knight Frank and London-based partner Knight Frank operate from over&nbsp;220 offices in established and emerging property markets on six continents.&nbsp;With a combined staff of 7,300 and revenues last year exceeding $861 million, this major force in real estate is meeting the local and global needs of owners, tenants, investors and developers worldwide.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Our Company', '', '', 'our-company.php', 0, 0, 0, 0, 1),
