INSERT INTO `news` (`news_id`, `news_title`, `news_description`, `news_short_description`, `redirect_link`, `news_image_path`, `display_order`, `is_active`, `news_start_date`, `news_end_date`, `created_date`) VALUES
(4, 'GTA West needs time to absorb office space', '', 'Over the last year the net rental rates in the core buildings, especially the older ones which have lost tenants to the new\r\nbuildings going up, have come down considerably, said Schaffer.\r\nSome tenants that weve been working with over the past 24 months originally started looking at brick and beam, but\r\nthen got better deals in some of the older buildings that have lost tenants or are going to lose tenants to some of the\r\nnew buildings.\r\nTenants are attracted to new LEED Gold and Platinum-certified buildings for environmental reasons, and other\r\namenities including outdoor terraces, showers, bicycle storage space, increased natural light via bigger windows, stateof-the-art\r\nbuilding automation systems, more efficient floor plates and raised flooring systems are also part of the draw', '', 'ProjectImages/News/122415144109.jpg', 0, 1, '0000-00-00', '0000-00-00', '2015-12-24'),
(5, 'New developments boost office vacancies in downtown Toronto', '', 'Space will sit empty longer, but I dont see any situation like we had in the early 90s when it was a bloodbath. Most of the developers today have very deep pockets and\r\ntheyll be aggressive in trying to fill the space. As long as we dont get into any kind of major recession, I dont think it will affect the market, except landlords will have to\r\nbecome more aggressive and creative in doing deals.\r\nJust under 3.4 million square feet of the 46 million square feet of office space in 115 class-A buildings in Torontos downtown area is vacant, according to the report.\r\nApproximately 990,000 of the 18 million square feet of space in 142 class-B buildings is available.', '', 'ProjectImages/News/122415144317.jpg', 0, 1, '0000-00-00', '0000-00-00', '2015-12-24'),
(6, 'Barry M. Gosin Speaks on Global Finance at the World Economic Forum', '', 'Barry M. Gosin Speaks on Global Finance at the World Economic Forum', 'http://www.weforum.org/events/world-economic-forum-annual-meeting-2016/sessions/the-global-debt-dilemma.com', 'ProjectImages/News/020516075348.png', 0, 1, '0000-00-00', '0000-00-00', '2016-02-05');
