INSERT INTO `our_rich` (`rich_key`, `rich_title`, `rich_image_path`, `rich_description`, `display_order`, `is_active`) VALUES
(6, 'Worldwide', 'ProjectImages/Our_Rich_Image/020416075302.jpg', '<p><strong>We cover the world</strong></p>\r\n\r\n<p>Newmark Grubb Knight Frank is one of the world&#39;s leading commercial real estate advisory firms. Together with London-based partner Knight Frank and independently-owned offices, NGKF&#39;s 12,000 professionals operate from more than 330 offices in established and emerging property markets on six continents.</p>\r\n\r\n<p>With roots dating back to 1929, NGKF&#39;s strong foundation makes it one of the most trusted names in commercial real estate. NGKF&#39;s full-service platform comprises BGC&#39;s real estate services segment, offering commercial real estate tenants, landlords, investors and developers a wide range of services including leasing; capital markets services, including investment sales, debt placement, appraisal, and valuation services; commercial mortgage brokerage services; as well as corporate advisory services, consulting, project and development management, and property and corporate facilities management services. For further information, visit www.ngkf.com.</p>\r\n\r\n<p>NGKF is a part of BGC Partners, Inc., a leading global brokerage company servicing the financial and real estate markets. BGC&#39;s common stock trades on the NASDAQ Global Select Market under the ticker symbol (NASDAQ: BGCP). BGC also has an outstanding bond issuance of Senior Notes due June 15, 2042, which trade on the New York Stock Exchange under the symbol (NYSE: BGCA). BGC Partners is led by Chairman and Chief Executive Officer Howard W. Lutnick. For more information, please visit http://www.bgcpartners.com/.</p>\r\n\r\n<p><strong>Explore the links below to learn more about our locations worldwide.</strong></p>\r\n', 2, 1),
(7, 'Canada', 'ProjectImages/Our_Rich_Image/020516113338.jpg', '<p><strong>From coast to coast, we are there for you</strong></p>\r\n\r\n<p>With offices in Toronto, Montr&eacute;al, Ottawa, Vancouver, Calgary, Edmonton, Qu&eacute;bec City and Halifax,&nbsp;NKF&nbsp;Devencore manages clients&#39; interests across Canada.</p>\r\n\r\n<p>The multidisciplinary team has a proven track record when it comes to carrying out NKF&nbsp;Devencore&#39;s mission. Each individual is highly qualified and motivated. They are strongly committed to the principle of complete openness with clients. This commitment is evident in their constant willingness to listen and their unwavering determination to make the fullest possible use of all available resources to arrive at the best possible solution.</p>\r\n', 1, 1);
