INSERT INTO `report` (`report_id`, `report_title`, `report_description`, `report_pdf_path`, `is_active`, `created_date`) VALUES
(4, 'MARKET INFORMATION', 'To keep abreast of current trends, NKF Devencore has developed highly efficient and specialized tools. Its unique database and DevReal (online database and lease-management tool) and DevPlan (proven methodology in the lease negotiation process) give clients access to high-calibre, unbiased information, making them part of an integrated approach aimed at optimizing the value of their transactions while saving time and money.', 'ProjectImages/Report/022316051506.pdf', 1, '2015-12-24 12:24:48');
