INSERT INTO `service` (`service_id`, `service_title`, `service_description`, `service_pdf_path`, `is_active`, `created_date`) VALUES
(5, 'Brokerage And Transaction Management', 'At NKF Devencore, we understand that every organization has space requirements that are unique. That''s why we''re committed to delivering strategic real estate solutions tailored to your specific situation. Our tenant-focused team provides a comprehensive range of services to assist you in addressing your real estate needs efficiently and cost-effectively, and for both the short and the long term. \r\n\r\nRelocation\r\nLease Recasting\r\nSpace Expansion / Reduction\r\nLease Renewals\r\nBuilt-To-Suit and Design Build Projects\r\nLease vs. Own Analysis\r\nLease Reviews\r\n ', 'ProjectImages/Service/122415115110.pdf', 1, '2015-12-24 11:48:48'),
(6, 'Advisory Services', 'Real estate portfolios and assets, regardless of their size or scope, must be viewed as strategic opportunities. At NKF Devencore, we''ve worked with companies both large and small to develop and implement detailed and real estate strategies precisely attuned to budgets and corporate objectives. Whether you lease or own, our advisory team can help your organization maximize the inherent value and potential of your real estate. \r\n\r\nHighest and Best Use Studies\r\nStrategic Real Estate Portfolio Analysis and Planning\r\nCost Containment Program\r\nSpace Utilization Models and Trends\r\nReal Estate Policies and Processes\r\nReal Estate Management Consulting\r\nAccommodation and Workplace Strategies\r\nUrban Movement and Economic Forecasting', '', 1, '2015-12-24 11:51:10'),
(7, 'Lease And Database Management Services', 'NKF Devencore''s Lease and Database Management Services are designed to assist public, private and crown corporations in the centralization, validation and administration of their real estate portfolios. Depending on your needs, we can provide a range of products and services, including:\r\n\r\nDatabase Management: DevReal Database\r\nLease Administration Services\r\nOn-line Reporting Tools\r\nWe have continously invested in our informations systems. Our clients have the option to monitor their real estate portfolio through the internet. This allows us to address the constant evolution of client requirements and emerging technologies. Our team has the expertise to provide our Lease and Database Management Services through the DevReal system or using a client''s in-house MIS application.', 'ProjectImages/Service/122415115156.pdf', 1, '2015-12-24 11:51:56'),
(8, 'Financial Services', 'For all companies, real estate needs and financial circumstances are in a constant state of evolution. For over 37 years, NKF Devencore has assisted organizations in the evaluation, planning and financial structuring of all manner of real estate ventures, from development projects and joint ventures to acquisitions and dispositions. Our professionals specialize in helping you assess the performance and your portfolio and extract maximum value. \r\n\r\nDevelopment Consulting\r\nInvestment Sales\r\nProject Packaging\r\nFinancing\r\nReal Estate Portfolio Analysis and Yield Optimization\r\nOther Financial Services', 'ProjectImages/Service/122415115511.pdf', 1, '2015-12-24 11:55:11'),
(9, 'Facilities And Project Management Advisory Services', 'NKF Devencore has assisted many of Canada''s largest companies with facilities and project management in both strategic and functional capacities. Our expertise extends to construction management, as well as IT and communications management. We have also counseled our clients extensively on environmental issues and have developed a special expertise in LEED (Leadership in Energy and Environmental Design) policies and certifications. In fact, NKF Devencore is a proud member of the Canada Green Building Council. Our major services can be regrouped as follows:\r\n\r\nFacility Management\r\nProject Management\r\nRelocation Management\r\nEnvironmental Management', 'ProjectImages/Service/122415115538.pdf', 1, '2015-12-24 11:55:38'),
(10, 'Strategic Planning And Advanced Strategies', 'Our experience and knowledge in developing a global strategic plan allows us to assist our clients in understanding the function and the impact of real estate on their operations. We understand the dynamics of the market place, allowing us to quickly assess and recommend an effective course of action. We also counsel leaders of organizations and their Board of Directors to appreciate and recommend real estate plans and develop global strategies.\r\n\r\nNKF Devencore is recognized for its objective advise and sound decision making at the most senior levels. We can support executives in the following areas:\r\n\r\nThe transition of a business direction into real estate strategies\r\nThe identification and the analysis of strategic information\r\nThe development of an executive roadmap to ensure objectives are met\r\nThe development of executive dashboard to monitor and evaluate results\r\nOnce a global plan is approved, NKF Devencore can also assist its clients in developing various advanced strategies and real estate models. These ensure our clients are most competitive and develop best practices in the corporate real estate world.', 'ProjectImages/Service/122415115707.pdf', 1, '2015-12-24 11:57:07'),
(11, 'Office', 'An office is more than just a place to work. It reflects the personality of the whole organization. Offices are a significant investment for occupants, who must consider a variety of factors (people, needs, furniture and equipment, efficiency, flexibility, IT, layout, area, image, etc.) that influence their real estate requirements and criteria. NKF Devencore understands these issues. After all, that is our business and we do it for the largest to the smallest companies in North America. We can help clients find solutions which will save them time and money.', 'ProjectImages/Service/122415115741.pdf', 1, '2015-12-24 11:57:41'),
(12, 'Industrial', 'Ceiling heights, stacking, shipping, energy, access to transportation... industries have all kinds of very special real estate needs. Thanks to our thorough knowledge of the industrial market, our understanding of industrial clients'' needs and our ability to provide technical support during construction, we can identify the right industrial premises, in some cases before they are even listed or built. From soil decontamination to customized construction, we offer clients an entire range of professional services and industrial spaces.', 'ProjectImages/Service/122415115810.pdf', 1, '2015-12-24 11:58:10'),
(13, 'Retail', 'NKF Devencore''s retail clients include financial institutions, specialized stores, bank branches, as well as numerous commercial tenants. We offer them services tailored to their specific concerns. Our thorough knowledge of local markets allows us to anticipate market trends, identify up-and-coming neighbourhoods and understand their dynamics and character. Rather than simply compiling data on space availability or current rents, NKF Devencore performs a complete x-ray examination of the market for its clients.', 'ProjectImages/Service/122415115840.pdf', 1, '2015-12-24 11:58:40'),
(14, 'Disposition', 'We know how to be effective\r\n\r\nNKF Devencore''s DevPosition system enables us to handle clients'' needs for disposing of surplus space or buildings quickly and efficiently. The system was developed by NKF Devencore''s own experts, and has proven its ability to help clients reach their objectives efficiently and professionally.\r\n\r\nAlways in line with our mission, we represent strictly the space user and therefore do not take any listings from landlords or developers.\r\n\r\nServices tailored to every situation\r\n\r\nSublets analysis\r\nLease cancellations\r\nProperty sales\r\nFinancial package creation and marketing', 'ProjectImages/Service/122415115913.pdf', 1, '2015-12-24 11:59:13');
